import React from 'react';
import {View, TouchableOpacity, Text} from 'react-native';
import Icon from 'react-native-vector-icons/AntDesign';
import styles from './paginas/Telainicial/style';


export default function Routes(){ 

      return(
        <View style= {{flex:1, backgroundColor: '#FFF'}}>
            <View style={styles.viewmax}>
                <TouchableOpacity>
                    <View >
                        <Icon name="home"
                        size={27}
                        color='#fff'
/>
                            </View>
                    
                           </TouchableOpacity>

                <TouchableOpacity>
                    <Icon name="search1"
                        size={27}
                        color='#fff' 
                        style={{
                            marginRight:20,
                            marginTop: 20,
                            marginLeft: 30,
                            backgroundColor: '#17A558',
                            borderRadius: 20,
                            width: 90,
                            height: 35,
                            }}
                            />
                            <Text style={{marginTop: -25, }}>Pesquisar</Text>
                            </TouchableOpacity>

                <TouchableOpacity>
                    <Icon name="bells"
                        size={27}
                        color='#fff' 
                        style={{
                            marginRight:20,
                            marginTop: 20,
                            marginLeft: 30,
                            backgroundColor: '#17A558',
                            borderRadius: 20, 
                            width: 90,
                            height: 35,
                            }}/>
                           </TouchableOpacity>
            </View>    
        </View>
      );
}
